import java.util.Scanner;

public class simpleinput {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner s = new Scanner(System.in);
int i=0;
int sum=0;
		while(i==0)
		{
         int t = s.nextInt();
         sum=sum+t;
         if(sum>0)
         {
        	 System.out.println(t);
         }
         else
         {
        	break; 
         }
		}

	
	
	
	
	
	
	
	
	
	
	
	
	}

}
